;studentafton presenterar en afton om ” metoo - ett år senare '' på årsdagen av bjuder studentafton och lunds studentkårer till en afton om metoo , rörelsen som ett års tid till stor del präglat samhällsdebatten . panelen kommer gudrun schyman , ulrika rogland och ola sigvardsson att medverka . aftonen äger rum universitetsaulan med sta kl . 19 ( .. ) . den 15 : e oktober 2017 skrev alyssa milano den tweet som kom att bli staskottet för vad som kallats en av de största folkrörelserna modern tid . genom metoo vittnade kändisar såväl som privatpersoner om övergrepp hem och på arbetsplatsen vilket resulterade en global kampanj mot sexuella trakasserier . ett år senare anordnar studentafton ett reflekterande panelsamtal där rörelsens betydelse för samtiden och framtiden diskuteras utifrån flera olika perspektiv . aftonen avslutas vanlig ordning med en frågestund där du som åhörare ges möjlighet att bidra till samtalet genom att ställa frågor till gästerna . gudrun schyman gudrun schyman är en av sveriges mest namnkunniga politiker och en frontfigur för den moderna feminismen . som pailedare för feministiskt initiativ har schyman förespråkat sociala reformer , skärpt lagstiftning och omfördelning av pengar och makt som en fosättning på metoo-rörelsen . ulrika rogland ulrika rogland är advokat specialiserad på vålds- och sexualbrott . sin roll som jurist har hon vid flera tillfällen uppmärksammats för sitt arbete med bland annat kvinnor , barn , och hedersvåld . 2016 var hon sommarvärd sommar p1 , där hon bland annat berättar om sitt arbete mot sexuella övergrepp . ola sigvardsson ola sigvardsson arbetar sedan 2011 som allmänhetens pressombudsman . pressombudsmannen fick efter metoo elva anmälningar mot tidningar för deras rappoering om händelserna kopplade till metoo . tio fall av elva fälldes tidningarna pressens opinionsnämnd . moderator för aftonen är kristin nord , journalist på sydsvenskan . när : den 15 oktober 2018 kl . 19 ( .. ) . var : universitetsaulan . pris :